import * as React from "react";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import axios from "axios";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: "skyblue",
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
    padding: 20,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: "silver",
  },
  "&:nth-of-type(even)": {
    backgroundColor: "white",
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));

const CustomizedTables = () => {
  const [state, setState] = React.useState({
    datas: [],
  });
  React.useEffect(() => {
    getUuser();
  }, []);
  const getUuser = () => {
    axios
      .get("https://mongo6.sultantracker.com/api/bincry/sold")
      .then((res) => {
        const data = res.data;
        console.log(data);
        const old = { ...state };
        old.datas = data;
        setState(old);
      });
  };
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead style={{ width: "120%" }}>
          <TableRow style={{ position: "fixed" }}>
            <StyledTableCell>selling_quantity</StyledTableCell>
            <StyledTableCell align="right">selling_amount</StyledTableCell>
            <StyledTableCell align="right">insert_date</StyledTableCell>
            <StyledTableCell align="right">currency</StyledTableCell>
            <StyledTableCell align="right">buying_price</StyledTableCell>
            <StyledTableCell align="right">buying_quantity</StyledTableCell>
            <StyledTableCell align="right">buying_amount</StyledTableCell>
            <StyledTableCell align="right">insert_date</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {state.datas.map((row, i) => (
            <StyledTableRow key={i}>
              <StyledTableCell component="th" scope="row">
                {row.selling_quantity}
              </StyledTableCell>
              <StyledTableCell align="right">
                {row.selling_amount}
              </StyledTableCell>
              <StyledTableCell align="right">{row.insert_date}</StyledTableCell>
              <StyledTableCell align="right">{row.currency}</StyledTableCell>
              <StyledTableCell align="right">
                {row.buying_price}
              </StyledTableCell>
              <StyledTableCell align="right">
                {row.buying_quantity}
              </StyledTableCell>
              <StyledTableCell align="right">
                {row.buying_amount}
              </StyledTableCell>
              <StyledTableCell align="right">{row.insert_date}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default CustomizedTables;
